import PendienteForm from './components/PendienteForm';
import PendienteList from './components/PendienteList';

function App() {
  return (
    <div className="container mt-5">
      <h1 className="mb-4">Lista de Pendientes</h1>
      <PendienteForm onAdd={() => window.location.reload()} />
      <PendienteList />
    </div>
  );
}

export default App;
